import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles, Divider } from '@material-ui/core';


let Root = styled.div({
  backgroundColor: 'primary',
  display: 'flex',
  // height: '100%',
  overflow: 'hidden',
  width: '100%',
  paddingTop: "10%"
})
let wrapper = styled.div({
  display: 'flex',
  flex: '1 1 auto',
  overflow: 'hidden',
  paddingTop: 64,
})
let contentContainer = styled.div({
  display: 'flex',
  flex: '1 1 auto',
  overflow: 'hidden'
})
let content = styled.div({
  flex: '1 1 auto',
  height: '100%',
  overflow: 'auto'
})
let Footer = styled.div({
  width: "100%",
  margin: "auto",
  padding: "0 0 1.5rem 0"
})
let footer_descript = styled.div({
  textAlign: "center",
  fontWeight: 200,
})
let footer_ment = styled.div({
  padding: 4,
  fontSize: 12
})
let footer_image = styled.div({
  textAlign: "center",
  marginTop: 20,
  marginBottom: 20
})

const footer_divider = styled(Divider)({
  marginTop: 50
})

const DashBoardFooterLayout = () => {
  const classes = useStyles();
  return (
    <Footer>
      <footer_divider/>
      <div className={classes.footer_image}>
        {/* <img src={TobelongLogo} /> */}
      </div>
      <footer_descript>
        <footer_ment>제공 서비스 : SOTHECODE_ERP ㅣ 회사명 : SOTHECODe</footer_ment>
        <footer_ment>Disclaimer: All content is provided for fun and entertainment purposes only</footer_ment>
        <footer_ment>ⓒ 2021. 소더코드 .All Rights Reserved.</footer_ment>
      </footer_descript>
    </Footer>
  );
};

DashBoardFooterLayout.propTypes = {
  children: PropTypes.node
};

export default DashBoardFooterLayout;
